import React from 'react';
import TextSwiper from '../TextSwiper';
import styles from './Passion.module.scss';

const { container, dohop, textWrapper, imageWrapper, paragraph } = styles;

const Passion = () => {
  return (
    <div className={container}>
      <h2>Career and passion</h2>
      <TextSwiper />
    </div>
  );
};

export default Passion;
